import React ,{Component} from 'react'
import"./toitems.css"
const Todoitems=(props)=>{
  const {items}=props
  const listitem=items.map(e=>{
    return(
      <div key={e.id}>
<span>{e.name}</span>
<span>{e.age}</span>
<span>&times</span>

      </div>
    )
  })
  return(

    <div>
    this is todolist
    </div>
  )
}
export default Todoitems
